        <h5>Add movie</h5>
        <AddMovie facade={facade} allDirectors={props.allDirectors} allActors={props.allActor} allGenres={props.allGenres} years={props.years} />
        <hr />
      </div>
    </Col>
  );
}
export default AdminMovies;
